import React, { Component } from "react";
import Axios from "axios";

export default class lawinfo extends Component {
  constructor() {
    super();
    this.state = {
      lawyer: "not yet",
    };
  }

  componentDidMount = () => {
    Axios.get("/lawyersReporter").then((response) => {
      //console.log(response.data.tem_c);
       //console.log(response.data);
       this.state({
         lawyer: response.data
    });
    });
  };

  render() {
    return (
      <div>
        <button>Lawyers</button>
        <h1>the list of all the lawyers are :{this.state.lawyer}</h1>
      </div>
    );
  }
}
